const entry=(new signalR.HubConnectionBuilder).withUrl("/entryHub").build();entry.on("Update",(n,t)=>{var i,r;if(console.log(n,t),n==="log"){const n=document.createElement("p");n.textContent=t;$("#log").html(n);document.getElementById("log").scrollTop=document.getElementById("log").scrollHeight}else n==="agregada"?$(".agregadas").html(t):n==="actualizada"?$(".actualizadas").html(t):n==="progress"?(i=t.toFixed(2),$("#progressHub").css("width",i+"%").attr("aria-valuenow",i).html(i+"%")):n==="status"&&(r="bg-"+t,$("#progressHub").removeClass("bg-danger bg-warning bg-success bg-info"),$("#progressHub").addClass(r))});entry.start().catch(n=>console.error(n.toString()));